import React from 'react';
import {Box} from '@mui/material';
function LoginPage() {
	const [opensignUp,SetOpen]=React.useState("none");
	return (
	  <Box className="loginpage" sx={{
      position :"fixed",
      justifyContent:"center",
      alignItems:"center",
      width:"40%",
      left:"30%",
      top:"20%",
      height:"500px",
      backgroundColor:"blue"
    }}>
      <h1> Log In</h1>

    </Box>
	);	
	}
export default LoginPage;
